s($,"aw_","ai6",()=>A.c([new A.mS("Webradio","\ud83c\udf99\ufe0f FICHE RESSOURCE \u2013 KIT WEBRADIO","Le kit de webradio mis \xe0 disposition par la DRANE permet aux \xe9quipes p\xe9dagogiques de concevoir, produire et diffuser des contenus audio dans un cadre \xe9ducatif. Il s\u2019adresse aussi bien aux projets disciplinaires qu\u2019aux activit\xe9s transversales, en classe ou dans le cadre d\u2019ateliers \xe9ducatifs.\n\nCe mat\xe9riel favorise l\u2019expression orale, le travail en \xe9quipe, la construction de contenus m\xe9diatiques et le d\xe9veloppement de comp\xe9tences num\xe9riques et citoyennes.\n","Domaines concern\xe9s :\n- \xc9ducation aux m\xe9dias et \xe0 l\u2019information (EMI)\n- Fran\xe7ais (oral, \xe9criture, argumentation)\n- Langues vivantes\n- Enseignement moral et civique\n- Projets interdisciplinaires ou de cycle\n- Liaison \xe9cole-coll\xe8ge ou coll\xe8ge-lyc\xe9e\n\nComp\xe9tences mobilis\xe9es :\n- Comp\xe9tences orales : aisance \xe0 l\u2019oral, diction, fluidit\xe9 de la parole, prise de parole en public\n- \xc9criture journalistique : r\xe9daction de chroniques, interviews, revues de presse\n- Comp\xe9tences num\xe9riques : montage audio, interface de mixage\n- Comp\xe9tences sociales et civiques : collaboration, gestion de projet, \xe9coute active\n- Ma\xeetrise de la langue : enrichissement lexical, reformulation, structuration du discours\n- Cr\xe9ativit\xe9 et esprit critique : choix des sujets, analyse des sources\n\nExemples de projets :\n- Journal radiophonique d\u2019\xe9tablissement\n- Capsules th\xe9matiques (actualit\xe9s, litt\xe9rature, sciences\u2026)\n- Interviews, d\xe9bats radiophoniques, rem\xe9diation fluence\n","- 1 table de mixage USB ou RODE Caster Pro 1\n- 4 micros dynamiques avec pieds et c\xe2bles XLR\n- 4 casques d\u2019\xe9coute\n- 1 enceinte de retour + c\xe2ble jack\n- 1 carte micro SD 32 Go\n\nNB : contenu exact pr\xe9cis\xe9 dans la fiche de pr\xeat.\n","Configuration requise : ordinateur avec port USB\n\nUtilisation : en int\xe9rieur, dans un espace calme\n\nLogiciels : Audacity, RODE Companion App (selon config)\n\nPr\xe9cautions :\n- Ne pas exposer les micros \xe0 l\u2019humidit\xe9 ou aux chocs\n- Ne pas modifier la configuration logicielle\n- \xc9teindre le mat\xe9riel apr\xe8s chaque s\xe9ance\n","- Tutoriel DRANE : https://podeduc.apps.education.fr/drane-de-la-reunion/rode-caster-1-tutoriels/\n- Canotech \u2013 Ateliers EMI\n- \xc9dubase \u2013 Sc\xe9narios Webradio\n- Fiche Eduscol \u2013 Usages p\xe9dagogiques\n- Outils num\xe9riques : Audacity\n")],A.a6("w<mS>")))
